    "An error occurred.": "\u05e7\u05e8\u05ea\u05d4 \u05e9\u05d2\u05d9\u05d0\u05d4.", 
    "An error occurred. Make sure that the student's username or email address is correct and try again.": "\u05d4\u05ea\u05e8\u05d7\u05e9\u05d4 \u05e9\u05d2\u05d9\u05d0\u05d4. \u05d5\u05d3\u05d0 \u05db\u05d9 \u05e9\u05dd \u05d4\u05de\u05e9\u05ea\u05de\u05e9 \u05e9\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 \u05d0\u05d5 \u05db\u05ea\u05d5\u05d1\u05ea \u05d4\u05d3\u05d5\u05d0\"\u05dc \u05e9\u05dc\u05d5 \u05e0\u05db\u05d5\u05e0\u05d4 \u05d5\u05e0\u05e1\u05d4 \u05e9\u05d5\u05d1.", 
