    "Emails successfully sent. The following users are no longer enrolled in the course:": "\u05d4\u05d5\u05d3\u05e2\u05d5\u05ea \u05d3\u05d5\u05d0\"\u05dc \u05e0\u05e9\u05dc\u05d7\u05d5 \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4. \u05d4\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d4\u05d1\u05d0\u05d9\u05dd \u05db\u05d1\u05e8 \u05dc\u05d0 \u05e8\u05e9\u05d5\u05de\u05d9\u05dd \u05dc\u05e7\u05d5\u05e8\u05e1:", 
    "Embed": "\u05d4\u05d8\u05de\u05e2\u05d4", 
    "Emoticons": "Emoticons", 
    "Enable Cohorts": "\u05d0\u05e4\u05e9\u05e8 \u05e7\u05d1\u05d5\u05e6\u05d5\u05ea \u05dc\u05d9\u05de\u05d5\u05d3", 
