    "End My Exam": "\u05e1\u05d9\u05d5\u05dd \u05d4\u05de\u05d1\u05d7\u05df \u05e9\u05dc\u05d9", 
    "End of transcript. Skip to the start.": "\u05e1\u05d5\u05e3 \u05d4\u05ea\u05e2\u05ea\u05d9\u05e7. \u05d3\u05dc\u05d2 \u05dc\u05d4\u05ea\u05d7\u05dc\u05d4.", 
    "Endorse": "\u05d0\u05e9\u05e8", 
    "Engage with posts": "\u05d4\u05e9\u05ea\u05ea\u05e3 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05e4\u05d5\u05e1\u05d8", 
    "Enrolling you in the selected course": "\u05e8\u05d5\u05e9\u05dd \u05d0\u05d5\u05ea\u05da \u05d1\u05e7\u05d5\u05e8\u05e1 \u05d4\u05e0\u05d1\u05d7\u05e8", 
    "Enrollment Date": "\u05ea\u05d0\u05e8\u05d9\u05da \u05d4\u05e8\u05e9\u05de\u05d4", 
    "Enrollment Mode": "\u05de\u05e6\u05d1 \u05d4\u05e8\u05e9\u05de\u05d4", 
    "Ensure that you can see your photo and read your name": "\u05d5\u05d3\u05d0 \u05db\u05d9 \u05e0\u05d9\u05ea\u05df \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05d4\u05ea\u05de\u05d5\u05e0\u05d4 \u05e9\u05dc\u05da \u05d5\u05dc\u05e7\u05e8\u05d5\u05d0 \u05d0\u05ea \u05d4\u05e9\u05dd \u05e9\u05dc\u05da.", 
    "Enter Due Date and Time": "\u05d4\u05d6\u05df \u05ea\u05d0\u05e8\u05d9\u05da \u05e1\u05d9\u05d5\u05dd \u05d5\u05e9\u05e2\u05d4", 
    "Enter Start Date and Time": "\u05d4\u05d6\u05df \u05ea\u05d0\u05e8\u05d9\u05da \u05d4\u05ea\u05d7\u05dc\u05d4 \u05d5\u05e9\u05e2\u05d4", 
    "Enter a student's username or email address.": "\u05d4\u05d6\u05df \u05e9\u05dd \u05de\u05e9\u05ea\u05de\u05e9 \u05d0\u05d5 \u05db\u05ea\u05d5\u05d1\u05ea \u05d3\u05d5\u05d0\"\u05dc \u05e9\u05dc \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8", 
    "Enter a username or email.": "\u05d4\u05db\u05e0\u05e1 \u05e9\u05dd \u05de\u05e9\u05ea\u05de\u05e9 \u05d0\u05d5 \u05d3\u05d5\u05d0\"\u05dc", 
    "Enter email addresses and/or usernames, separated by new lines or commas, for the students you want to add. *": "\u05e2\u05d1\u05d5\u05e8 \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd \u05e9\u05d1\u05e8\u05e6\u05d5\u05e0\u05da \u05dc\u05d4\u05d5\u05e1\u05d9\u05e3, \u05d4\u05d6\u05df \u05db\u05ea\u05d5\u05d1\u05d5\u05ea \u05d3\u05d5\u05d0\u05e8 \u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9 \u05d5/\u05d0\u05d5 \u05e9\u05de\u05d5\u05ea \u05de\u05e9\u05ea\u05de\u05e9, \u05de\u05d5\u05e4\u05e8\u05d3\u05d9\u05dd \u05e2\u05dc \u05d9\u05d3\u05d9 \u05e9\u05d5\u05e8\u05d4 \u05d7\u05d3\u05e9\u05d4 \u05d0\u05d5 \u05e4\u05e1\u05d9\u05e7. * ", 
    "Enter information to describe your team. You cannot change these details after you create the team.": "\u05d4\u05d6\u05df \u05de\u05d9\u05d3\u05e2 \u05db\u05d3\u05d9 \u05dc\u05ea\u05d0\u05e8 \u05d0\u05ea \u05d4\u05e6\u05d5\u05d5\u05ea \u05e9\u05dc\u05da. \u05dc\u05d0 \u05e0\u05d9\u05ea\u05df \u05dc\u05e9\u05e0\u05d5\u05ea \u05d0\u05ea \u05d4\u05e4\u05e8\u05d8\u05d9\u05dd \u05d4\u05dc\u05dc\u05d5 \u05dc\u05d0\u05d7\u05e8 \u05d9\u05e6\u05d9\u05e8\u05ea \u05d4\u05e6\u05d5\u05d5\u05ea.", 
    "Enter team description.": "\u05d4\u05d6\u05df \u05ea\u05d9\u05d0\u05d5\u05e8 \u05e6\u05d5\u05d5\u05ea.", 
    "Enter team name.": "\u05d4\u05d6\u05df \u05e9\u05dd \u05e6\u05d5\u05d5\u05ea.", 
    "Enter the enrollment code.": "\u05d4\u05d6\u05df \u05e7\u05d5\u05d3 \u05d4\u05e8\u05e9\u05de\u05d4.", 
    "Enter the name of the cohort": "\u05d4\u05d6\u05df \u05d0\u05ea \u05d4\u05e9\u05dd \u05e9\u05dc \u05e7\u05d1\u05d5\u05e6\u05ea \u05d4\u05dc\u05d9\u05de\u05d5\u05d3", 
    "Enter the page number you'd like to quickly navigate to.": "\u05d4\u05d6\u05df \u05d0\u05ea \u05de\u05e1\u05e4\u05e8 \u05d4\u05d3\u05e3 \u05e9\u05d1\u05e8\u05e6\u05d5\u05e0\u05da \u05dc\u05e0\u05d5\u05d5\u05d8 \u05d1\u05d5 \u05d1\u05de\u05d4\u05d9\u05e8\u05d5\u05ea.", 
    "Enter the username or email address of each learner that you want to add as an exception.": "\u05d4\u05d6\u05df \u05e9\u05dd \u05de\u05e9\u05ea\u05de\u05e9 \u05d0\u05d5 \u05db\u05ea\u05d5\u05d1\u05ea \u05d3\u05d5\u05d0\"\u05dc \u05e9\u05dc \u05db\u05dc \u05ea\u05dc\u05de\u05d9\u05d3 \u05e9\u05d1\u05e8\u05e6\u05d5\u05e0\u05da \u05dc\u05d4\u05d5\u05e1\u05d9\u05e3 \u05db\u05d7\u05e8\u05d9\u05d2.", 
    "Enter username or email": "\u05d4\u05db\u05e0\u05e1 \u05e9\u05dd \u05de\u05e9\u05ea\u05de\u05e9 \u05d0\u05d5 \u05db\u05ea\u05d5\u05d1\u05ea \u05d3\u05d5\u05d0\u05e8 \u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9", 
    "Enter your question or comment": "\u05d4\u05d6\u05df \u05d0\u05ea \u05e9\u05d0\u05dc\u05ea\u05da \u05d0\u05d5 \u05d4\u05e2\u05e8\u05ea\u05da", 
    "Entrance exam attempts is being reset for student '{student_id}'.": "\u05d1\u05d7\u05d9\u05e0\u05ea \u05db\u05e0\u05d9\u05e1\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '{student_id}' \u05d1\u05ea\u05d4\u05dc\u05d9\u05da \u05d0\u05d9\u05e4\u05d5\u05e1 \u05db\u05e2\u05ea.", 
    "Entrance exam state is being deleted for student '{student_id}'.": "\u05de\u05e6\u05d1 \u05d1\u05d7\u05d9\u05e0\u05ea \u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05e0\u05de\u05d7\u05e7 \u05e2\u05d1\u05d5\u05e8 \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '{student_id}'.", 
    "Error": "\u05e9\u05d2\u05d9\u05d0\u05d4", 
    "Error adding students.": "\u05d8\u05e2\u05d5\u05ea \u05d1\u05d4\u05d5\u05e1\u05e4\u05ea \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd", 
    "Error adding/removing users as beta testers.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05d4\u05d5\u05e1\u05e4\u05d4 / \u05d4\u05e1\u05e8\u05d4 \u05e9\u05dc \u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05db\u05d1\u05d5\u05d3\u05e7\u05d9 \u05d1\u05d8\u05d0.", 
    "Error changing user's permissions.": "\u05d8\u05e2\u05d5\u05ea \u05d1\u05e9\u05d9\u05e0\u05d5\u05d9 \u05d0\u05d9\u05e9\u05d5\u05e8\u05d9 \u05de\u05e9\u05ea\u05de\u05e9", 
    "Error deleting entrance exam state for student '{student_id}'. Make sure student identifier is correct.": "\u05d8\u05e2\u05d5\u05ea \u05d1\u05de\u05d7\u05d9\u05e7\u05d4 \u05e9\u05dc \u05de\u05e6\u05d1 \u05de\u05d1\u05d7\u05df \u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '{student_id}'. \u05d5\u05d3\u05d0 \u05e9\u05de\u05d6\u05d4\u05d4 \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 \u05e0\u05db\u05d5\u05df. ", 
    "Error deleting student '<%= student_id %>'s state on problem '<%= problem_id %>'. Make sure that the problem and student identifiers are complete and correct.": "\u05d8\u05e2\u05d5\u05ea \u05d1\u05de\u05d7\u05d9\u05e7\u05d4 \u05e9\u05dc \u05de\u05e6\u05d1 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05e9\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '<%= student_id %>' \u05d1\u05d1\u05e2\u05d9\u05d4 '<%= problem_id %>'. \u05d5\u05d3\u05d0 \u05db\u05d9 \u05de\u05d6\u05d4\u05d9 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05d5\u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 \u05e9\u05dc\u05de\u05d9\u05dd \u05d5\u05de\u05d3\u05d5\u05d9\u05e7\u05d9\u05dd. ", 
    "Error enrolling/unenrolling users.": "\u05e9\u05d2\u05d9\u05d0\u05ea \u05e8\u05d9\u05e9\u05d5\u05dd/\u05d1\u05d9\u05d8\u05d5\u05dc \u05e8\u05d9\u05e9\u05d5\u05dd \u05e9\u05dc \u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd.", 
    "Error generating ORA data report. Please try again.": "\u05d0\u05d9\u05e8\u05e2\u05d4 \u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05e2\u05ea \u05d3\u05d5\u05d7 \u05e0\u05ea\u05d5\u05e0\u05d9 ORA. \u05e0\u05e1\u05d4 \u05e9\u05d5\u05d1.", 
    "Error generating grades. Please try again.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05d6\u05de\u05df \u05d9\u05e6\u05d9\u05e8\u05ea \u05e6\u05d9\u05d5\u05e0\u05d9\u05dd. \u05d0\u05e0\u05d0 \u05e0\u05e1\u05d4 \u05e9\u05d5\u05d1.", 
    "Error generating list of students who may enroll. Please try again.": "\u05d0\u05d9\u05e8\u05e2\u05d4 \u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05e2\u05ea \u05d9\u05e6\u05d9\u05e8\u05ea \u05e8\u05e9\u05d9\u05de\u05ea \u05e9\u05dc \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd \u05e9\u05e2\u05e9\u05d5\u05d9\u05d9\u05dd \u05dc\u05d4\u05d9\u05e8\u05e9\u05dd. \u05e0\u05e1\u05d4 \u05e9\u05d5\u05d1.", 
