    "Error generating proctored exam results. Please try again.": "\u05d0\u05d9\u05e8\u05e2\u05d4 \u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05e2\u05ea \u05d9\u05e6\u05d9\u05e8\u05ea \u05ea\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05d1\u05d7\u05e0\u05d9\u05dd \u05ea\u05d7\u05ea \u05e4\u05d9\u05e7\u05d5\u05d7. \u05e0\u05e1\u05d4 \u05e9\u05d5\u05d1.", 
    "Error generating student profile information. Please try again.": "\u05e9\u05d2\u05d9\u05d0\u05ea \u05d1\u05d6\u05de\u05df \u05d9\u05e6\u05d9\u05e8\u05ea \u05e4\u05e8\u05d5\u05e4\u05d9\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8. \u05d0\u05e0\u05d0 \u05e0\u05e1\u05d5 \u05e9\u05d5\u05d1.", 
