    "Error getting entrance exam task history for student '{student_id}'. Make sure student identifier is correct.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05e7\u05d1\u05dc\u05ea \u05d4\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d4 \u05e9\u05dc \u05de\u05e9\u05d9\u05de\u05d5\u05ea \u05de\u05d1\u05d7\u05df \u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '{student_id}'. \u05d5\u05d3\u05d0 \u05e9\u05de\u05d6\u05d4\u05d4 \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 \u05e0\u05db\u05d5\u05df.  ", 
