    "Successfully sent enrollment emails to the following users. They will be allowed to enroll once they register:": "\u05de\u05d9\u05d9\u05dc\u05d9\u05dd \u05d4\u05e8\u05e9\u05de\u05d4 \u05e0\u05e9\u05dc\u05d7\u05d5 \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4 \u05dc\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d4\u05d1\u05d0\u05d9\u05dd. \u05d4\u05dd \u05d9\u05d4\u05d9\u05d5 \u05e8\u05e9\u05d0\u05d9\u05dd \u05dc\u05d4\u05d9\u05e8\u05e9\u05dd \u05d1\u05e8\u05d2\u05e2 \u05e9\u05d4\u05dd \u05d9\u05d9\u05e8\u05e9\u05de\u05d5 \u05dc\u05d0\u05ea\u05e8:", 
