    "Successfully started task to rescore problem '<%= problem_id %>' for all students. Click the 'Show Background Task History for Problem' button to see the status of the task.": "\u05d4\u05ea\u05d7\u05d9\u05dc \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4 \u05de\u05e9\u05d9\u05de\u05d4 \u05dc\u05ea\u05ea \u05e6\u05d9\u05d5\u05df \u05de\u05d7\u05d3\u05e9 \u05dc\u05d1\u05e2\u05d9\u05d4 '<%= problem_id %>' \u05e2\u05d1\u05d5\u05e8 \u05db\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd. \u05dc\u05d7\u05e5 \u05e2\u05dc \u05db\u05e4\u05ea\u05d5\u05e8 '\u05d4\u05e6\u05d2 \u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05ea \u05de\u05e9\u05d9\u05de\u05d5\u05ea \u05e8\u05e7\u05e2 \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e2\u05d9\u05d4' \u05d1\u05db\u05d3\u05d9 \u05dc\u05e8\u05d0\u05d5\u05ea \u05d3\u05d5\u05d7 \u05de\u05e6\u05d1 \u05e2\u05d1\u05d5\u05e8 \u05de\u05e9\u05d9\u05de\u05d4. ", 
    "Successfully started task to reset attempts for problem '<%= problem_id %>'. Click the 'Show Background Task History for Problem' button to see the status of the task.": "\u05d4\u05ea\u05d7\u05d9\u05dc \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4 \u05d0\u05ea \u05d4\u05de\u05e9\u05d9\u05de\u05d4 \u05dc\u05d0\u05d9\u05e4\u05d5\u05e1 \u05e0\u05e1\u05d9\u05d5\u05e0\u05d5\u05ea \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e2\u05d9\u05d4 '<%= problem_id %>'. \u05dc\u05d7\u05e5 \u05e2\u05dc \u05db\u05e4\u05ea\u05d5\u05e8 '\u05d4\u05e6\u05d2 \u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05ea \u05de\u05e9\u05d9\u05de\u05d5\u05ea \u05e8\u05e7\u05e2 \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e2\u05d9\u05d4' \u05dc\u05e8\u05d0\u05d5\u05ea \u05d3\u05d5\u05d7 \u05de\u05e6\u05d1 \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e2\u05d9\u05d4.  ", 
