    "Try the transaction again in a few minutes.": "\u05e0\u05e1\u05d4 \u05d0\u05ea \u05d4\u05e2\u05e1\u05e7\u05d4 \u05e9\u05d5\u05d1 \u05d1\u05e2\u05d5\u05d3 \u05db\u05de\u05d4 \u05d3\u05e7\u05d5\u05ea.", 
    "Try using a different browser, such as Google Chrome.": "\u05e0\u05e1\u05d4 \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05d3\u05e4\u05d3\u05e4\u05df \u05d0\u05d7\u05e8 \u05dc\u05d3\u05d5\u05d2\u05de\u05d0 \u05d2\u05d5\u05d2\u05dc \u05db\u05e8\u05d5\u05dd.", 
