    "Uploaded file issues. Click on \"+\" to view.": "\u05d1\u05e2\u05d9\u05d5\u05ea \u05d1\u05d4\u05e2\u05dc\u05d0\u05ea \u05e7\u05d5\u05d1\u05e5. \u05dc\u05d7\u05e5 \u05e2\u05dc \"+\" \u05db\u05d3\u05d9 \u05dc\u05d4\u05e6\u05d9\u05d2.", 
    "Uploading": "\u05de\u05e2\u05dc\u05d4", 
    "Upper Alpha": "\u05d0\u05d5\u05ea\u05d9\u05d5\u05ea \u05d2\u05d3\u05d5\u05dc\u05d5\u05ea", 
    "Upper Roman": "\u05d0\u05d5\u05ea\u05d5\u05d9\u05d5\u05ea \u05e8\u05d5\u05de\u05d9\u05d5\u05ea \u05d2\u05d3\u05d5\u05dc\u05d5\u05ea", 
    "Upset Learner": "\u05ea\u05dc\u05de\u05d9\u05d3 \u05de\u05d5\u05d3\u05d0\u05d2", 
    "Url": "Url", 
    "Use Current Transcript": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05ea\u05de\u05dc\u05d9\u05dc \u05e0\u05d5\u05db\u05d7\u05d9", 
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05d7\u05d1\u05df \u05ea\u05d7\u05ea \u05e4\u05d9\u05e7\u05d5\u05d7 \u05db\u05d3\u05d9 \u05dc\u05d4\u05e6\u05d9\u05d2 \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d0\u05ea \u05db\u05dc\u05d9 \u05d5\u05ea\u05d4\u05dc\u05d9\u05db\u05d9 \u05d4\u05e4\u05d9\u05e7\u05d5\u05d7. \u05d4\u05ea\u05d5\u05e6\u05d0\u05d5\u05ea \u05e9\u05dc \u05de\u05d1\u05d7\u05df \u05d4\u05ea\u05e8\u05d2\u05d5\u05dc \u05d0\u05d9\u05e0\u05df \u05e4\u05d5\u05d2\u05e2\u05d5\u05ea \u05d1\u05e6\u05d9\u05d5\u05df \u05e9\u05dc \u05d4\u05de\u05e9\u05ea\u05de\u05e9.", 
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05d1\u05d7\u05df \u05de\u05ea\u05d5\u05d6\u05de\u05df \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d1\u05d9\u05dc \u05d0\u05ea \u05d4\u05d6\u05de\u05df \u05e9\u05d4\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d9\u05db\u05d5\u05dc\u05d9\u05dd \u05dc\u05d4\u05e9\u05e7\u05d9\u05e2 \u05d1\u05d1\u05e2\u05d9\u05d5\u05ea \u05d1\u05ea\u05ea \u05e1\u05e2\u05d9\u05e3 \u05d6\u05d4. \u05d4\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d7\u05d9\u05d9\u05d1\u05d9\u05dd \u05dc\u05d4\u05d2\u05d9\u05e9 \u05ea\u05e9\u05d5\u05d1\u05d5\u05ea \u05dc\u05e4\u05e0\u05d9 \u05e9\u05d4\u05d6\u05de\u05df \u05ea\u05dd. \u05ea\u05d5\u05db\u05dc \u05dc\u05d0\u05e4\u05e9\u05e8 \u05d6\u05de\u05df \u05e0\u05d5\u05e1\u05e3 \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05d0\u05d9\u05e0\u05d3\u05d9\u05d1\u05d9\u05d3\u05d5\u05d0\u05dc\u05d9\u05d9\u05dd \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05de\u05e8\u05db\u05d6 \u05d4\u05e9\u05dc\u05d9\u05d8\u05d4 \u05e9\u05dc \u05d4\u05d0\u05d7\u05e8\u05d0\u05d9.", 
    "Use as a Prerequisite": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05db\u05d3\u05e8\u05d9\u05e9\u05d4 \u05de\u05d5\u05e7\u05d3\u05de\u05ea", 
    "Use bookmarks to help you easily return to courseware pages. To bookmark a page, select Bookmark in the upper right corner of that page. To see a list of all your bookmarks, select Bookmarks in the upper left corner of any courseware page.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05e1\u05d9\u05de\u05e0\u05d9\u05d5\u05ea \u05db\u05d3\u05d9 \u05dc\u05e1\u05d9\u05d9\u05e2 \u05dc\u05da \u05dc\u05d7\u05d6\u05d5\u05e8 \u05d1\u05e7\u05dc\u05d5\u05ea \u05dc\u05d3\u05e4\u05d9 \u05ea\u05d5\u05db\u05e0\u05ea \u05d4\u05e7\u05d5\u05e8\u05e1. \u05db\u05d3\u05d9 \u05dc\u05e1\u05de\u05df \u05d1\u05e1\u05d9\u05de\u05e0\u05d9\u05d4 \u05d3\u05e3, \u05d1\u05d7\u05e8 '\u05e1\u05d9\u05de\u05e0\u05d9\u05d4' \u05d1\u05e4\u05d9\u05e0\u05d4 \u05d4\u05d9\u05de\u05e0\u05d9\u05ea \u05d4\u05e2\u05dc\u05d9\u05d5\u05e0\u05d4 \u05e9\u05dc \u05d3\u05e3 \u05d6\u05d4. \u05db\u05d3\u05d9 \u05dc\u05e8\u05d0\u05d5\u05ea \u05e8\u05e9\u05d9\u05de\u05d4 \u05e9\u05dc \u05db\u05dc \u05d4\u05e1\u05d9\u05de\u05e0\u05d9\u05d5\u05ea, \u05d1\u05d7\u05e8 '\u05e1\u05d9\u05de\u05e0\u05d9\u05d5\u05ea' \u05d1\u05e4\u05d9\u05e0\u05d4 \u05d4\u05e9\u05de\u05d0\u05dc\u05d9\u05ea \u05d4\u05e2\u05dc\u05d9\u05d5\u05e0\u05d4 \u05e9\u05dc \u05db\u05dc \u05d0\u05d7\u05d3 \u05de\u05d3\u05e4\u05d9 \u05ea\u05d5\u05db\u05e0\u05ea \u05d4\u05de\u05d7\u05e9\u05d1 \u05e9\u05dc \u05d4\u05e7\u05d5\u05e8\u05e1.", 
    "Use my institution/campus credentials": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05d4\u05e8\u05e9\u05d0\u05d5\u05ea \u05de\u05d5\u05e1\u05d3/\u05e7\u05de\u05e4\u05d5\u05e1", 
    "Use the Discussion Topics menu to find specific topics.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05ea\u05e4\u05e8\u05d9\u05d8 '\u05e0\u05d5\u05e9\u05d0\u05d9\u05dd \u05dc\u05d3\u05d9\u05d5\u05df' \u05db\u05d3\u05d9 \u05dc\u05de\u05e6\u05d5\u05d0 \u05e0\u05d5\u05e9\u05d0\u05d9\u05dd \u05e1\u05e4\u05e6\u05d9\u05e4\u05d9\u05d9\u05dd.", 
    "Use the retake photo button if you are not pleased with your photo": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05db\u05e4\u05ea\u05d5\u05e8 \u05e6\u05dc\u05dd \u05de\u05d7\u05d3\u05e9 \u05d0\u05dd \u05d0\u05ea\u05d4 \u05dc\u05d0 \u05de\u05e8\u05d5\u05e6\u05d4 \u05de\u05d4\u05ea\u05de\u05d5\u05e0\u05d4 \u05e9\u05dc\u05da", 
    "Use your webcam to take a photo of your ID. We will match this photo with the photo of your face and the name on your account.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05e6\u05dc\u05de\u05ea \u05d4\u05e8\u05e9\u05ea \u05e9\u05dc\u05da \u05dc\u05e6\u05dc\u05dd \u05ea\u05de\u05d5\u05e0\u05d4 \u05e9\u05dc \u05d4\u05ea\u05e2\u05d5\u05d3\u05d4 \u05d4\u05de\u05d6\u05d4\u05d4 \u05e9\u05dc\u05da. \u05d0\u05e0\u05d5 \u05e0\u05ea\u05d0\u05d9\u05dd \u05d0\u05ea \u05d4\u05ea\u05de\u05d5\u05e0\u05d4 \u05d4\u05d6\u05d5 \u05dc\u05ea\u05de\u05d5\u05e0\u05d4 \u05e9\u05dc \u05d4\u05e4\u05e8\u05e6\u05d5\u05e3 \u05e9\u05dc\u05da \u05d5\u05dc\u05e9\u05dd \u05d4\u05d7\u05e9\u05d1\u05d5\u05df \u05e9\u05dc\u05da. ", 
    "Use your webcam to take a photo of your face. We will match this photo with the photo on your ID.": "\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05e6\u05dc\u05de\u05ea \u05d4\u05e8\u05e9\u05ea \u05e9\u05dc\u05da \u05dc\u05e6\u05dc\u05dd \u05d0\u05ea \u05d4\u05e4\u05e8\u05d5\u05e6\u05e3 \u05e9\u05dc\u05da. \u05d0\u05e0\u05d7\u05e0\u05d5 \u05e0\u05e9\u05d5\u05d5\u05d4 \u05d0\u05ea \u05d4\u05ea\u05de\u05d5\u05e0\u05d4 \u05dc\u05ea\u05de\u05d5\u05e0\u05d4 \u05e9\u05dc\u05da \u05d1\u05ea\u05e2\u05d5\u05d3\u05d4 \u05d4\u05de\u05d6\u05d4\u05d4.", 
