    "Video transcript": "\u05ea\u05e2\u05ea\u05d9\u05e7 \u05e1\u05e8\u05d8\u05d5\u05df \u05d5\u05d9\u05d3\u05d0\u05d5", 
    "VideoPlayer: Element corresponding to the given selector was not found.": "\u05e0\u05d2\u05df \u05d4\u05d5\u05d9\u05d3\u05d9\u05d0\u05d5: \u05d4\u05d0\u05dc\u05de\u05e0\u05d8 \u05d4\u05e7\u05e9\u05d5\u05e8 \u05dc", 
    "View": "\u05d4\u05e6\u05d2", 
    "View %(span_start)s %(team_name)s %(span_end)s": "\u05d4\u05e6\u05d2 %(span_start)s %(team_name)s %(span_end)s", 
    "View Cohort": "\u05e6\u05e4\u05d4 \u05d1\u05e7\u05d1\u05d5\u05e6\u05ea \u05dc\u05d9\u05de\u05d5\u05d3", 
    "View Live": "\u05ea\u05e6\u05d5\u05d2\u05d4 \u05d7\u05d9\u05d4", 
    "View Teams in the %(topic_name)s Topic": "\u05d4\u05e6\u05d2 \u05e6\u05d5\u05d5\u05ea\u05d9\u05dd \u05d1\u05e0\u05d5\u05e9\u05d0 %(topic_name)s", 
    "View all errors": "\u05e6\u05e4\u05d4 \u05d1\u05db\u05dc \u05d4\u05d8\u05e2\u05d5\u05d9\u05d5\u05ea", 
